(239, 19, '_elementor_data', '[{\"id\":\"7d9edf6\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"3104f3f6\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"3069199\",\"elType\":\"widget\",\"settings\":{\"title\":\"Bienvenue sur Ma-liseuse\",\"title_color\":\"#000000\"},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"d225f88\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/localhost:8888\\/wordpress\\/wp-content\\/uploads\\/2020\\/03\\/book-3610618_1280.jpg\",\"id\":88},\"image_size\":\"full\"},\"elements\":[],\"widgetType\":\"image\"},{\"id\":\"7d8712b5\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<!-- wp:paragraph -->\\n<p><strong>Une liseuse, est un appareil mobile con\\u00e7u principalement pour lire des livres num\\u00e9riques. L\\u2019appareil est dot\\u00e9 d\\u2019un \\u00e9cran pour la lecture et doit permettre le stockage des publications num\\u00e9riques pour la cr\\u00e9ation d\\u2019une biblioth\\u00e8que num\\u00e9rique.<\\/strong><\\/p>\\n<!-- \\/wp:paragraph -->\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"88781d3\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\"},\"elements\":[{\"id\":\"81efb55\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"1e59899\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/localhost:8888\\/wordpress\\/wp-content\\/uploads\\/2020\\/03\\/kobo-3544072_1920.jpg\",\"id\":67},\"image_size\":\"custom\",\"image_custom_dimension\":{\"width\":\"1200\",\"height\":\"750\"}},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false},{\"id\":\"55d38df\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"377f749\",\"elType\":\"widget\",\"settings\":{\"title\":\"Notre Activit\\u00e9\",\"title_color\":\"#000000\"},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"7cbab2e\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Nous essayons de faire de notre mieux pour vous fournir du contenu qualitatif afin de bien choisir votre liseuse. Notre but est \\u00e9galement de vous donner les meilleurs conseils pour acheter votre prochaine liseuse. Choisissez votre\\u00a0<strong>liseuse num\\u00e9rique\\u00a0<\\/strong>gr\\u00e2ce \\u00e0 notre blog et nos comparatifs au meilleurs prix.<br \\/>Baladez vous sur notre blog pour chercher et acheter votre prochain outil technologique.<\\/p>\\n<p>Liseuse Num\\u00e9rique est beaucoup plus qu\\u2019un comparateur. C\\u2019est aussi un espace d\\u2019\\u00e9change. Les prix des liseuses sont v\\u00e9rifi\\u00e9s tous les mois.<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"66d2272\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"6513995\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"e125145\",\"elType\":\"widget\",\"settings\":{\"title\":\"Galerie des produits phares\",\"title_color\":\"#000000\"},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"cbdc292\",\"elType\":\"widget\",\"settings\":{\"wp_gallery\":[{\"id\":74,\"url\":\"http:\\/\\/localhost:8888\\/wordpress\\/wp-content\\/uploads\\/2020\\/03\\/kindle-1.jpg\"},{\"id\":76,\"url\":\"http:\\/\\/localhost:8888\\/wordpress\\/wp-content\\/uploads\\/2020\\/03\\/Woxter.jpg\"},{\"id\":84,\"url\":\"http:\\/\\/localhost:8888\\/wordpress\\/wp-content\\/uploads\\/2020\\/03\\/kobo_libra_h2o_white_k1909054728416A_100943822.jpg\"},{\"id\":86,\"url\":\"http:\\/\\/localhost:8888\\/wordpress\\/wp-content\\/uploads\\/2020\\/03\\/kobo.jpg\"}]},\"elements\":[],\"widgetType\":\"image-gallery\"}],\"isInner\":false}],\"isInner\":false}]'),
