(18, 1, '2020-03-05 20:00:37', '2020-03-05 19:00:37', '<!-- wp:group {\"align\":\"wide\"} --><div class=\"wp-block-group alignwide\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"align\":\"center\"} --><h2 class=\"has-text-align-center\">La première destination pour l’art moderne dans le nord de la Suède. Ouvert de 10h à 18h tous les jours pendant les mois d’été.</h2><!-- /wp:heading --></div></div><!-- /wp:group --><!-- wp:columns {\"align\":\"wide\"} --><div class=\"wp-block-columns alignwide\"><!-- wp:column --><div class=\"wp-block-column\"><!-- wp:group --><div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:image {\"align\":\"full\",\"id\":37,\"sizeSlug\":\"full\"} --><figure class=\"wp-block-image alignfull size-full\"><img src=\"http://localhost:8888/wordpress/wp-content/themes/twentytwenty/assets/images/2020-three-quarters-1.png\" alt=\"\" class=\"wp-image-37\"/></figure><!-- /wp:image --><!-- wp:heading {\"level\":3} --><h3>Travaux et jours</h3><!-- /wp:heading --><!-- wp:paragraph --><p>1er août au 1er décembre</p><!-- /wp:paragraph --><!-- wp:button {\"className\":\"is-style-outline\"} --><div class=\"wp-block-button is-style-outline\"><a class=\"wp-block-button__link\" href=\"https://make.wordpress.org/core/2019/09/27/block-editor-theme-related-updates-in-wordpress-5-3/\">Lire la suite</a></div><!-- /wp:button --></div></div><!-- /wp:group --><!-- wp:group --><div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:image {\"align\":\"full\",\"id\":37,\"sizeSlug\":\"full\"} --><figure class=\"wp-block-image alignfull size-full\"><img src=\"http://localhost:8888/wordpress/wp-content/themes/twentytwenty/assets/images/2020-three-quarters-3.png\" alt=\"\" class=\"wp-image-37\"/></figure><!-- /wp:image --><!-- wp:heading {\"level\":3} --><h3>Théâtre des opérations</h3><!-- /wp:heading --><!-- wp:paragraph --><p>1er octobre au 1er décembre</p><!-- /wp:paragraph --><!-- wp:button {\"className\":\"is-style-outline\"} --><div class=\"wp-block-button is-style-outline\"><a class=\"wp-block-button__link\" href=\"https://make.wordpress.org/core/2019/09/27/block-editor-theme-related-updates-in-wordpress-5-3/\">Lire la suite</a></div><!-- /wp:button --></div></div><!-- /wp:group --></div><!-- /wp:column --><!-- wp:column --><div class=\"wp-block-column\"><!-- wp:group --><div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:image {\"align\":\"full\",\"id\":37,\"sizeSlug\":\"full\"} --><figure class=\"wp-block-image alignfull size-full\"><img src=\"http://localhost:8888/wordpress/wp-content/themes/twentytwenty/assets/images/2020-three-quarters-2.png\" alt=\"\" class=\"wp-image-37\"/></figure><!-- /wp:image --><!-- wp:heading {\"level\":3} --><h3>La vie que je mérite</h3><!-- /wp:heading --><!-- wp:paragraph --><p>1er août au 1er décembre</p><!-- /wp:paragraph --><!-- wp:button {\"className\":\"is-style-outline\"} --><div class=\"wp-block-button is-style-outline\"><a class=\"wp-block-button__link\" href=\"https://make.wordpress.org/core/2019/09/27/block-editor-theme-related-updates-in-wordpress-5-3/\">Lire la suite</a></div><!-- /wp:button --></div></div><!-- /wp:group --><!-- wp:group --><div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:image {\"align\":\"full\",\"id\":37,\"sizeSlug\":\"full\"} --><figure class=\"wp-block-image alignfull size-full\"><img src=\"http://localhost:8888/wordpress/wp-content/themes/twentytwenty/assets/images/2020-three-quarters-4.png\" alt=\"\" class=\"wp-image-37\"/></figure><!-- /wp:image --><!-- wp:heading {\"level\":3} --><h3>De Signac à Matisse</h3><!-- /wp:heading --><!-- wp:paragraph --><p>1er octobre au 1er décembre</p><!-- /wp:paragraph --><!-- wp:button {\"className\":\"is-style-outline\"} --><div class=\"wp-block-button is-style-outline\"><a class=\"wp-block-button__link\" href=\"https://make.wordpress.org/core/2019/09/27/block-editor-theme-related-updates-in-wordpress-5-3/\">Lire la suite</a></div><!-- /wp:button --></div></div><!-- /wp:group --></div><!-- /wp:column --></div><!-- /wp:columns --><!-- wp:image {\"align\":\"full\",\"id\":37,\"sizeSlug\":\"full\"} --><figure class=\"wp-block-image alignfull size-full\"><img src=\"http://localhost:8888/wordpress/wp-content/themes/twentytwenty/assets/images/2020-landscape-2.png\" alt=\"\" class=\"wp-image-37\"/></figure><!-- /wp:image --><!-- wp:group {\"align\":\"wide\"} --><div class=\"wp-block-group alignwide\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"align\":\"center\",\"textColor\":\"accent\"} --><h2 class=\"has-accent-color has-text-align-center\">« Les cyborgs, comme l’a fait remarquer la philosophe Donna Haraway, ne sont pas respectueux. Ils ne se souviennent pas du cosmos. »</h2><!-- /wp:heading --></div></div><!-- /wp:group --><!-- wp:paragraph {\"dropCap\":true} --><p class=\"has-drop-cap\">Avec ses sept étages d’architecture remarquable, le E-Mucem présente des expositions d’art contemporain international, parfois accompagnées de rétrospectives sur l’histoire de l’art. Les questions existentielles, politiques et philosophiques font partie intégrante de notre programme. En tant que visiteur, vous êtes invité à des visites guidées, des conférences, des projections de films et d’autres évènements avec entrée gratuite.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Les expositions sont produites par le E-Mucem en collaboration avec des artistes et des musées du monde entier et attirent souvent l’attention internationale. Le E-Mucem a reçu une mention spéciale du Musée européen de l’année et a été l’un des meilleurs candidats pour le Prix du Musée méditerranéen de l’année ainsi que pour le Prix du Musée du Conseil de l’Europe.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p></p><!-- /wp:paragraph --><!-- wp:group {\"customBackgroundColor\":\"#ffffff\",\"align\":\"wide\"} --><div class=\"wp-block-group alignwide has-background\" style=\"background-color:#ffffff\"><div class=\"wp-block-group__inner-container\"><!-- wp:group --><div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"align\":\"center\"} --><h2 class=\"has-text-align-center\">Devenez membre et obtenez des offres exclusives !</h2><!-- /wp:heading --><!-- wp:paragraph {\"align\":\"center\"} --><p class=\"has-text-align-center\">Les adhérent·es ont accès à des expositions et des ventes exclusives. Notre abonnement coûtent $99.99 et est facturé annuellement.</p><!-- /wp:paragraph --><!-- wp:button {\"align\":\"center\"} --><div class=\"wp-block-button aligncenter\"><a class=\"wp-block-button__link\" href=\"https://make.wordpress.org/core/2019/09/27/block-editor-theme-related-updates-in-wordpress-5-3/\">Rejoignez le club</a></div><!-- /wp:button --></div></div><!-- /wp:group --></div></div><!-- /wp:group --><!-- wp:gallery {\"ids\":[39,38],\"align\":\"wide\"} --><figure class=\"wp-block-gallery alignwide columns-2 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost:8888/wordpress/wp-content/themes/twentytwenty/assets/images/2020-square-2.png\" alt=\"\" data-id=\"39\" data-full-url=\"http://localhost:8888/wordpress/wp-content/themes/twentytwenty/assets/images/2020-square-2.png\" data-link=\"assets/images/2020-square-2/\" class=\"wp-image-39\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost:8888/wordpress/wp-content/themes/twentytwenty/assets/images/2020-square-1.png\" alt=\"\" data-id=\"38\" data-full-url=\"http://localhost:8888/wordpress/wp-content/themes/twentytwenty/assets/images/2020-square-1.png\" data-link=\"http://localhost:8888/wordpress/wp-content/themes/twentytwenty/assets/images/2020-square-1/\" class=\"wp-image-38\"/></figure></li></ul></figure><!-- /wp:gallery -->', 'Le nouveau E-Mucem ouvre ses portes', '', 'publish', 'closed', 'closed', '', 'le-nouveau-e-mucem-ouvre-ses-portes-2', '', '', '2020-03-05 20:00:37', '2020-03-05 19:00:37', '', 0, 'http://localhost:8888/wordpress/?page_id=18', 0, 'page', '', 0),
(19, 1, '2020-03-05 20:00:38', '2020-03-05 19:00:38', '<h2>Bienvenue sur Ma-liseuse</h2>		\n										<img width=\"1280\" height=\"853\" src=\"http://localhost:8888/wordpress/wp-content/uploads/2020/03/book-3610618_1280.jpg\" alt=\"\" srcset=\"http://localhost:8888/wordpress/wp-content/uploads/2020/03/book-3610618_1280.jpg 1280w, http://localhost:8888/wordpress/wp-content/uploads/2020/03/book-3610618_1280-300x200.jpg 300w, http://localhost:8888/wordpress/wp-content/uploads/2020/03/book-3610618_1280-1024x682.jpg 1024w, http://localhost:8888/wordpress/wp-content/uploads/2020/03/book-3610618_1280-768x512.jpg 768w, http://localhost:8888/wordpress/wp-content/uploads/2020/03/book-3610618_1280-600x400.jpg 600w\" sizes=\"(max-width: 1280px) 100vw, 1280px\" />											\n		<!-- wp:paragraph -->\n<p><strong>Une liseuse, est un appareil mobile conçu principalement pour lire des livres numériques. L’appareil est doté d’un écran pour la lecture et doit permettre le stockage des publications numériques pour la création d’une bibliothèque numérique.</strong></p>\n<!-- /wp:paragraph -->		\n										<img src=\"http://localhost:8888/wordpress/wp-content/uploads/elementor/thumbs/kobo-3544072_1920-om65o83y0s46dy271qbpa4ctfppkpx37u63j7zsevg.jpg\" title=\"kobo-3544072_1920\" alt=\"kobo-3544072_1920\" />											\n			<h2>Notre Activité</h2>		\n		<p>Nous essayons de faire de notre mieux pour vous fournir du contenu qualitatif afin de bien choisir votre liseuse. Notre but est également de vous donner les meilleurs conseils pour acheter votre prochaine liseuse. Choisissez votre <strong>liseuse numérique </strong>grâce à notre blog et nos comparatifs au meilleurs prix.<br />Baladez vous sur notre blog pour chercher et acheter votre prochain outil technologique.</p>\n<p>Liseuse Numérique est beaucoup plus qu’un comparateur. C’est aussi un espace d’échange. Les prix des liseuses sont vérifiés tous les mois.</p>		\n			<h2>Galerie des produits phares</h2>		\n		<style type=\"text/css\">\n			#gallery-1 {\n				margin: auto;\n			}\n			#gallery-1 .gallery-item {\n				float: left;\n				margin-top: 10px;\n				text-align: center;\n				width: 25%;\n			}\n			#gallery-1 img {\n				border: 2px solid #cfcfcf;\n			}\n			#gallery-1 .gallery-caption {\n				margin-left: 0;\n			}\n			/* see gallery_shortcode() in wp-includes/media.php */\n		</style>\n		<dl class=\'gallery-item\'>\n			<dt class=\'gallery-icon landscape\'>\n				<a data-elementor-open-lightbox=\"yes\" data-elementor-lightbox-slideshow=\"cbdc292\" data-elementor-lightbox-title=\"kindle\" href=\'http://localhost:8888/wordpress/wp-content/uploads/2020/03/kindle-1.jpg\'><img width=\"150\" height=\"150\" src=\"http://localhost:8888/wordpress/wp-content/uploads/2020/03/kindle-1-150x150.jpg\" alt=\"\" aria-describedby=\"gallery-1-74\" srcset=\"http://localhost:8888/wordpress/wp-content/uploads/2020/03/kindle-1-150x150.jpg 150w, http://localhost:8888/wordpress/wp-content/uploads/2020/03/kindle-1-300x300.jpg 300w, http://localhost:8888/wordpress/wp-content/uploads/2020/03/kindle-1-100x100.jpg 100w\" sizes=\"(max-width: 150px) 100vw, 150px\" /></a>\n			</dt>\n				<dd class=\'wp-caption-text gallery-caption\' id=\'gallery-1-74\'>\n				Kindle Noire \n				</dd></dl><dl class=\'gallery-item\'>\n			<dt class=\'gallery-icon landscape\'>\n				<a data-elementor-open-lightbox=\"yes\" data-elementor-lightbox-slideshow=\"cbdc292\" data-elementor-lightbox-title=\"Woxter\" href=\'http://localhost:8888/wordpress/wp-content/uploads/2020/03/Woxter.jpg\'><img width=\"150\" height=\"150\" src=\"http://localhost:8888/wordpress/wp-content/uploads/2020/03/Woxter-150x150.jpg\" alt=\"\" aria-describedby=\"gallery-1-76\" srcset=\"http://localhost:8888/wordpress/wp-content/uploads/2020/03/Woxter-150x150.jpg 150w, http://localhost:8888/wordpress/wp-content/uploads/2020/03/Woxter-300x300.jpg 300w, http://localhost:8888/wordpress/wp-content/uploads/2020/03/Woxter-100x100.jpg 100w\" sizes=\"(max-width: 150px) 100vw, 150px\" /></a>\n			</dt>\n				<dd class=\'wp-caption-text gallery-caption\' id=\'gallery-1-76\'>\n				Woxter Scriba Bleue\n				</dd></dl><dl class=\'gallery-item\'>\n			<dt class=\'gallery-icon landscape\'>\n				<a data-elementor-open-lightbox=\"yes\" data-elementor-lightbox-slideshow=\"cbdc292\" data-elementor-lightbox-title=\"kobo_libra_h2o_white_k1909054728416A_100943822\" href=\'http://localhost:8888/wordpress/wp-content/uploads/2020/03/kobo_libra_h2o_white_k1909054728416A_100943822.jpg\'><img width=\"150\" height=\"150\" src=\"http://localhost:8888/wordpress/wp-content/uploads/2020/03/kobo_libra_h2o_white_k1909054728416A_100943822-150x150.jpg\" alt=\"\" aria-describedby=\"gallery-1-84\" srcset=\"http://localhost:8888/wordpress/wp-content/uploads/2020/03/kobo_libra_h2o_white_k1909054728416A_100943822-150x150.jpg 150w, http://localhost:8888/wordpress/wp-content/uploads/2020/03/kobo_libra_h2o_white_k1909054728416A_100943822-300x300.jpg 300w, http://localhost:8888/wordpress/wp-content/uploads/2020/03/kobo_libra_h2o_white_k1909054728416A_100943822-100x100.jpg 100w\" sizes=\"(max-width: 150px) 100vw, 150px\" /></a>\n			</dt>\n				<dd class=\'wp-caption-text gallery-caption\' id=\'gallery-1-84\'>\n				Housse Ibroz Aura Noir\n				</dd></dl><dl class=\'gallery-item\'>\n			<dt class=\'gallery-icon landscape\'>\n				<a data-elementor-open-lightbox=\"yes\" data-elementor-lightbox-slideshow=\"cbdc292\" data-elementor-lightbox-title=\"kobo\" href=\'http://localhost:8888/wordpress/wp-content/uploads/2020/03/kobo.jpg\'><img width=\"150\" height=\"150\" src=\"http://localhost:8888/wordpress/wp-content/uploads/2020/03/kobo-150x150.jpg\" alt=\"\" aria-describedby=\"gallery-1-86\" srcset=\"http://localhost:8888/wordpress/wp-content/uploads/2020/03/kobo-150x150.jpg 150w, http://localhost:8888/wordpress/wp-content/uploads/2020/03/kobo-300x300.jpg 300w, http://localhost:8888/wordpress/wp-content/uploads/2020/03/kobo-100x100.jpg 100w\" sizes=\"(max-width: 150px) 100vw, 150px\" /></a>\n			</dt>\n				<dd class=\'wp-caption-text gallery-caption\' id=\'gallery-1-86\'>\n				Kobo Aura\n				</dd></dl><br style=\"clear: both\" />', '', '', 'publish', 'closed', 'closed', '', 'a-propos-de', '', '', '2020-03-06 14:44:11', '2020-03-06 13:44:11', '', 0, 'http://localhost:8888/wordpress/?page_id=19', 0, 'page', '', 0),
