(68, 1, '2020-03-06 13:40:40', '2020-03-06 12:40:40', '<h2>Bienvenue sur Ma-liseuse</h2>		\n										<img width=\"1024\" height=\"682\" src=\"http://localhost:8888/wordpress/wp-content/uploads/2020/03/kobo-395006_1280-1-1024x682.jpg\" alt=\"\" srcset=\"http://localhost:8888/wordpress/wp-content/uploads/2020/03/kobo-395006_1280-1-1024x682.jpg 1024w, http://localhost:8888/wordpress/wp-content/uploads/2020/03/kobo-395006_1280-1-300x200.jpg 300w, http://localhost:8888/wordpress/wp-content/uploads/2020/03/kobo-395006_1280-1-768x512.jpg 768w, http://localhost:8888/wordpress/wp-content/uploads/2020/03/kobo-395006_1280-1-600x400.jpg 600w, http://localhost:8888/wordpress/wp-content/uploads/2020/03/kobo-395006_1280-1.jpg 1280w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" />											\n		<!-- wp:paragraph -->\n<p><strong>Une liseuse, est un appareil mobile conçu principalement pour lire des livres numériques. L’appareil est doté d’un écran pour la lecture et doit permettre le stockage des publications numériques pour la création d’une bibliothèque numérique.</strong></p>\n<!-- /wp:paragraph -->		\n										<img src=\"http://localhost:8888/wordpress/wp-content/uploads/elementor/thumbs/kobo-3544072_1920-om65o83vl2t98b7r37hecbra3c5upg9hil3adz1s74.jpg\" title=\"kobo-3544072_1920\" alt=\"kobo-3544072_1920\" />											\n			<h2>Notre Activité</h2>		\n		<p>Nous essayons de faire de notre mieux pour vous fournir du contenu qualitatif afin de bien choisir votre liseuse. Notre but est également de vous donner les meilleurs conseils pour acheter votre prochaine liseuse. Choisissez votre <strong>liseuse numérique </strong>grâce à notre blog et nos comparatifs au meilleurs prix.<br />Baladez vous sur notre blog pour chercher et acheter votre prochain outil technologique.</p>\n<p>Liseuse Numérique est beaucoup plus qu’un comparateur. C’est aussi un espace d’échange. Les prix des liseuses sont vérifiés tous les mois.</p>', 'À propos de', '', 'inherit', 'closed', 'closed', '', '19-revision-v1', '', '', '2020-03-06 13:40:40', '2020-03-06 12:40:40', '', 19, 'http://localhost:8888/wordpress/2020/03/06/19-revision-v1/', 0, 'revision', '', 0),
