(94, 1, '2020-03-31 17:57:06', '2020-03-31 15:57:06', '', 'choisir_liseuse', '', 'inherit', 'open', 'closed', '', 'choisir_liseuse', '', '', '2020-03-31 17:57:06', '2020-03-31 15:57:06', '', 92, 'http://localhost:8080/wordpress/wp-content/uploads/2020/03/choisir_liseuse.jpg', 0, 'attachment', 'image/jpeg', 0),
(95, 1, '2020-03-31 18:17:57', '2020-03-31 16:17:57', '<img width=\"1280\" height=\"550\" src=\"http://localhost:8080/wordpress/wp-content/uploads/2020/03/choisir_liseuse.jpg\" alt=\"\" srcset=\"http://localhost:8080/wordpress/wp-content/uploads/2020/03/choisir_liseuse.jpg 1280w, http://localhost:8080/wordpress/wp-content/uploads/2020/03/choisir_liseuse-300x129.jpg 300w, http://localhost:8080/wordpress/wp-content/uploads/2020/03/choisir_liseuse-1024x440.jpg 1024w, http://localhost:8080/wordpress/wp-content/uploads/2020/03/choisir_liseuse-768x330.jpg 768w, http://localhost:8080/wordpress/wp-content/uploads/2020/03/choisir_liseuse-600x258.jpg 600w\" sizes=\"(max-width: 1280px) 100vw, 1280px\">\n\n<strong>L\'entreprise <em>ma-liseuse&nbsp;</em></strong>', 'Histoire', '', 'inherit', 'closed', 'closed', '', '92-revision-v1', '', '', '2020-03-31 18:17:57', '2020-03-31 16:17:57', '', 92, 'http://localhost:8080/wordpress/2020/03/31/92-revision-v1/', 0, 'revision', '', 0),
(96, 1, '2020-03-31 18:23:00', '2020-03-31 16:23:00', '<img width=\"1280\" height=\"550\" src=\"http://localhost:8080/wordpress/wp-content/uploads/2020/03/choisir_liseuse.jpg\" alt=\"\" srcset=\"http://localhost:8080/wordpress/wp-content/uploads/2020/03/choisir_liseuse.jpg 1280w, http://localhost:8080/wordpress/wp-content/uploads/2020/03/choisir_liseuse-300x129.jpg 300w, http://localhost:8080/wordpress/wp-content/uploads/2020/03/choisir_liseuse-1024x440.jpg 1024w, http://localhost:8080/wordpress/wp-content/uploads/2020/03/choisir_liseuse-768x330.jpg 768w, http://localhost:8080/wordpress/wp-content/uploads/2020/03/choisir_liseuse-600x258.jpg 600w\" sizes=\"(max-width: 1280px) 100vw, 1280px\" />											\n		<p>Si vous êtes actuellement à la recherche d’une liseuse qui vous permettra de lire vos romans et vos livres préférés, alors sachez que vous êtes tombé au bon endroit. L\'entreprise ma-liseuse, fondée en 2018, est avant tout née pour répondre à de nouveaux besoins écologiques. Et oui, les livres c’est bien mais question écologique, ce n’est pas le top. De plus, vous n’êtes pas sans savoir qu’en termes d’accommodation, ils sont loin d’être les plus ergonomiques.</p><p>Grâce à ma-liseuse, vous pourrez vous équipez de tablettes non seulement ergonomique et facile à transporter, mais elles peuvent également contenir tous vos ouvrages virtuellement. En optant pour un tel équipement, vous allez donc forcément faire de la place dans votre bibliothèque. Mais comme tout autre produit technologique, ce n’est pas le choix qui manque, loin de là d’ailleurs !</p><p>De nos jours, plusieurs marques se sont approprié ce petit appareil de dernière génération afin de desservir les plus grands amateurs de lecture.</p><p>Ainsi, pour vous orienter dans vos choix, ma-liseuse s\'emploie depuis sa création à vous proposer une offre à la fois riche et variée, qui conviendra en fonction des besoins. </p>', 'Histoire', '', 'inherit', 'closed', 'closed', '', '92-revision-v1', '', '', '2020-03-31 18:23:00', '2020-03-31 16:23:00', '', 92, 'http://localhost:8080/wordpress/2020/03/31/92-revision-v1/', 0, 'revision', '', 0),
